import { useEffect, useState } from "react";

const LeadersTable = ({data}) => {
const [dataInfo,setDataInfo] = useState([]);

useEffect(()=>{
  setDataInfo(data);
},[data]);
  return (
    <div>
      <div style={{}}>
        <input placeholder="sdsdfsdf" type={"text"} />
      </div>
      <table style={{width : "80%",margin: "50px auto"}}>
          <thead>
              <tr>
                  <td>ציון ממוצע סופי</td>
                  <td>ציון ממוצע למטלה</td>
                  <td>עיר</td>
                  <td>תלמידים</td>
                  <td>כיתה</td>
                  <td>בית ספר</td>
                  <td>מקום</td>
              </tr>
          </thead>
          <tbody>
            {dataInfo.map(row => {
                return (
                    <tr>
                    <td>{row.overallAvgGrade}</td>
                    <td>{row.avgGradePerAssignment}</td>
                    <td>{row.city}</td>
                    <td>{row.howManyStudents}</td>
                    <td>{row.grade}</td>
                    <td>{row.school}</td>
                    <td>{row.place}</td>
                </tr>
                );
            })}
          </tbody>
      </table>
    </div>
  );
};

export default LeadersTable;
